import React, { Component } from 'react';
import '../../css/Home.css';
import { Client, Team } from 'espn-fantasy-football-api/node';

const ffClient = new Client({ leagueId: 434534});
const team = new Team();

const SID = 2020;
const ESPNS2 = 'AEBV85dIvuqsM9iU%2Foq7ESnJOQ313AdIv2G7CqQk%2FeWIbYQh2QmagVAWq%2BgsGJTFq8rD4eCDFaczJTSUhvsoKS1hCgoXvvsVyh7T1K%2BWq55ree3Z6mL3CvwTSZ5yrZ9v5VCQyDKo8Wp4E4F7FHxhsdwAfhwn9NK2Na1eQpCbJfqiVokhTL9n%2Bm9Gw%2B%2Bi7956QVKxR65Q2sZvVqScwjXcC9YYff9y2wb8uKPelYOdpDh9qHmTFIb8mGcmVt6GK8JQPejA6VD1fXwPy5GQ0p8pt531';
const SWID = '{DC03AED4-FCA6-4FC2-83AE-D4FCA68FC233}';

ffClient.setCookies({ espnS2: ESPNS2,
    SWID: SWID});



class SideStandings extends Component {

    getStandings() {
        ffClient.getLeagueInfo({seasonID: SID}).then(response=> {
            console.log({response});
        })
    }

    render() {
        return (
            <div className="sidebar">
                side standings ayyyy
                {this.getStandings()}
            </div>
        )
    }
}

export default SideStandings;
